import React from 'react';
import {IoLocationSharp} from 'react-icons/io5';

function TopBar() {

    return(
        <div style={{display: 'flex', flexDirection: 'row', alignItems: 'center', justifyContent: 'center', height: 100, backgroundColor: "orange"}}>
            <IoLocationSharp style={{fontSize: 24, display: 'flex', color: "#fff"}}/>
            <select style={{display: 'flex', backgroundColor: '#fff', height: 50, width: 280, padding: 15, borderRadius: 25}}>
                <option>Helsinki</option>
                <option>Pori</option>
                <option>Turku</option>
            </select>
        </div>
    )
}

export default TopBar;
